import React from 'react';
import { Box } from '@mui/joy';
import Header from './Header';
import SelectCat from './SelectCat';
import SelectHeigth from './SelectHeigth';
import SelectRad from './SelectRad';
import SelectBranch from './SelectBranch';
import BasicCard from './Cards';
import CustomIcons from './Pagination';
import Footer from './Footer';
import SelectBtn from './SelectBtn';
import SaleBasket from './SaleBasket';

export default function FormControlLabelPosition() {
  return (
    <Box
      display={'flex'}
      flexDirection={'column'}
      alignItems={'center'}
      marginBottom={'30px'}
    >
      <Header />
      <Box
        display={'flex'}
        flexDirection={'row'}
        marginTop={'100px'}
        gap={'30px'}
        alignItems={'center'}
        flexWrap={'wrap'}
      >
        <SelectCat />
        <SelectHeigth />
        <SelectRad />
        <SelectBranch />
        <SelectBtn />
      </Box>
      <Box
        display={'flex'}
        flexWrap={'wrap'}
        gap={'30px'}
        justifyContent={'center'}
        marginTop={'30px'}
      >
        <BasicCard />
      </Box>
      <CustomIcons sx={{ marginTop: '30px' }} />
      <Footer />
    </Box>
  );
}
